import React from 'react'
import styled from 'styled-components';

const Input = styled.div`
  width: 343px;
  height: 48px;
  background: #FFFFF;
  border-radius: 6px;
  border: #C1C1C1;
`;

// Functional component
function InputField(){
    return <input type="email" />
}


export default InputField;
